import "../App.css";
import Navbar from "./Navbar";
import GroupList from "./GroupList";
import ListItems from "./ListItems";

function App() {
  return (
    <>
      <Navbar projectname="To - Do List" />
      <div className="container w">
        <h1>To - Do</h1>
        <GroupList />
        <ListItems />
      </div>
    </>
  );
}

export default App;
